import React, { useState } from "react";
import axios from "axios";
import "./FileUpload.css";

const PreprocessingDashboard = () => {
  const [selectedFile, setSelectedFile] = useState(null);
  const [selectedOperation, setSelectedOperation] = useState("");
  const [uploadedFilename, setUploadedFilename] = useState("");
  const [processingResult, setProcessingResult] = useState(null);
  const [visualization, setVisualization] = useState(null);
  const [error, setError] = useState("");

  const handleFileChange = (event) => {
    const file = event.target.files[0];
    if (file && file.name.endsWith(".csv")) {
      setSelectedFile(file);
      setError("");
    } else {
      setError("Please upload a valid CSV file.");
      setSelectedFile(null);
    }
  };

  const handleUpload = async () => {
    if (!selectedFile) {
      setError("Please select a CSV file first.");
      return;
    }

    const formData = new FormData();
    formData.append("file", selectedFile);

    try {
      const response = await axios.post("http://localhost:5000/upload", formData);
      setUploadedFilename(response.data.filename);
      setError("");
    } catch (err) {
      setError("File upload failed.");
    }
  };

  const handleProcessing = async () => {
    if (!uploadedFilename || !selectedOperation) {
      setError("Please upload a file and select an operation.");
      return;
    }

    try {
      const response = await axios.post("http://localhost:5000/process", {
        filename: uploadedFilename,
        operation: selectedOperation,
      });
      setProcessingResult(response.data.table);
      setError("");
    } catch (err) {
      setError("Data processing failed.");
    }
  };

  const handleVisualization = async () => {
    if (!uploadedFilename || !selectedOperation) {
      setError("Please upload a file and select an operation.");
      return;
    }

    try {
      const response = await axios.post("http://localhost:5000/visualize", {
        filename: uploadedFilename,
        operation: selectedOperation,
      });

      setVisualization(`data:image/png;base64,${response.data.image}`);
      setError("");
    } catch (err) {
      setError("Visualization failed.");
    }
  };

  return (
    <div className="container">
      <h2>Data Preprocessing Dashboard</h2>

      <input type="file" onChange={handleFileChange} accept=".csv" />
      <button className="btn-primary mt-3" onClick={handleUpload}>Upload File</button>

      {uploadedFilename && <p>Uploaded: {uploadedFilename}</p>}

      <div className="mt-4">
        <select value={selectedOperation} onChange={(e) => setSelectedOperation(e.target.value)}>
          <option value="">Select an Operation</option>
          <option value="sampling">Sampling</option>
          <option value="normalization">Normalization</option>
          <option value="pca">PCA</option>
          <option value="clustering">Clustering</option>
          <option value="market_analysis">Market Analysis</option>
        </select>
        <button className="btn-success" onClick={handleProcessing}>Process Data</button>
        <button className="btn-success" onClick={handleVisualization}>Visualize</button>
      </div>

      {error && <p>{error}</p>}

      {processingResult && (
        <div className="mt-4">
          <h3>Processed Data</h3>
          <div dangerouslySetInnerHTML={{ __html: processingResult }} />
        </div>
      )}

      {visualization && (
        <div className="mt-4">
          <h3>Visualization</h3>
          <img src={visualization} alt="Visualization" style={{ width: "100%", borderRadius: "5px" }} />
        </div>
      )}
    </div>
  );
};

export default PreprocessingDashboard;
